            {questId = 66042,reputation = 1250,},--patterns-within-patterns need to check this -- \n        },\n    },\n}\n\n-- output--\naura_env.text = '';\naura_env.update_overview_display = function()\n    local text = ''\n    -----------------------------------------------------Todo list Prep--------------------------------------------------------------------------- \n    for _, todoEntry in ipairs(aura_env.todoList) do\n        -- PINK --\n        local entry, color, completed, maximum = '', 'ffff00ff', 0, #todoEntry.quests\n        if todoEntry.name == 'Rares' or todoEntry.name == 'worldQuests' or\n        todoEntry.name == 'worldBoss' and aura_env.config['includeWorldBoss'] or\n        todoEntry.name == 'duneDominance' and aura_env.config['includeDuneDominance'] or\n        todoEntry.name == 'weeklyQuest' and aura_env.config['includeWeeklyQuest'] then\n            if todoEntry.maximum then\n                maximum = todoEntry.maximum\n            end\n            for _, todoQuest in ipairs(todoEntry.quests) do\n                if todoEntry.name == 'worldQuests' then\n                    if aura_env.is_quest_completed(todoQuest.questId) then\n                        completed = completed + 1\n                    end\n                else\n                    if aura_env.is_quest_completed(todoQuest.questId) then\n                        completed = completed + 1\n                    end\n                end\n            end\n            if (maximum > 1) and (completed >= (maximum / 2)) then\n                -- Burnt Orange --\n                color = 'ffff7801'\n            end \n            if completed >= maximum then\n                -- JADE--\n                color = 'FF00ff96'\n            end\n            \n            if completed >= maximum then\n                if todoEntry.name == 'Rares' or\n                todoEntry.name == 'worldQuests' and not aura_env.config['hideWorldQuestsIfCompleted'] or\n                todoEntry.name == 'worldBoss' and not aura_env.config['hideWorldBossIfCompleted'] or\n                todoEntry.name == 'duneDominance' and not aura_env.config['hideDuneDominanceIfCompleted'] or\n                todoEntry.name == 'weeklyQuest' and not aura_env.config['hideWeeklyQuestIfCompleted'] then\n                    entry = aura_env.get_text_snippet(todoEntry.name) .. ': ' .. WrapTextInColorCode(completed .. ' / ' .. maximum, color) .. '\\r\\n'\n                end\n            else\n                entry = aura_env.get_text_snippet(todoEntry.name) .. ': ' .. WrapTextInColorCode(completed .. ' / ' .. maximum, color) .. '\\r\\n'\n            end\n            \n            text = text .. entry\n        end\n    end\n    \n    return text\nend\n---- calculate/display rep ----\naura_env.update_reputation_display = function()\n    local text = aura_env.get_text_snippet('reputationCurrent')\n    local name, description, standing, minimum, maximum, current = GetFactionInfoByID(aura_env.factionID)\n    local possibleGain = 0\n    if (C_Reputation.IsFactionParagon(aura_env.factionID)) then\n        text = text .. aura_env.get_text_snippet('reputationParagon')\n    end\n    \n    for _, todoEntry in ipairs(aura_env.todoList) do\n        if todoEntry.name == 'worldQuests' then\n            local completed = 0   \n            for _, todoQuest in ipairs(todoEntry.quests) do\n                if aura_env.is_quest_completed(todoQuest.questId) then\n                    completed = completed + 1\n                end\n            end\n            possibleGain = possibleGain + ((3 - completed) * 125)\n        else\n            if\n            (todoEntry.name == 'Rares') or\n            (todoEntry.name == 'worldBoss' and aura_env.config['includeWorldBoss']) or\n            (todoEntry.name == 'duneDominance' and aura_env.config['includeDuneDominance']) or\n            (todoEntry.name == 'weeklyQuest' and aura_env.config['includeWeeklyQuest']) then\n                for _, todoQuest in ipairs(todoEntry.quests) do\n                    if not aura_env.is_quest_completed(todoQuest.questId) then\n                        possibleGain = possibleGain + todoQuest.reputation\n                    end\n                end\n            end\n        end\n    end\n    \n    text = text .. aura_env.get_text_snippet('reputationGain') .. possibleGain .. '\\r\\n'\n    \n    return text\nend\n\naura_env.update_rare_list_display = function()\n    local text = ''\n    --todo list output -- \n    for _, todoEntry in ipairs(aura_env.todoList) do\n        if todoEntry.name == 'Rares' then\n            -- Yellow--\n            local entry, color = nil, 'ffffff00'\n            for _, todoQuest in ipairs(todoEntry.quests) do\n                if\n                not aura_env.is_quest_completed(todoQuest.questId) or\n                aura_env.is_quest_completed(todoQuest.questId) and not aura_env.config['hideRareIfCompleted'] then\n                    if aura_env.is_quest_completed(todoQuest.questId) then\n                        color = 'ff8c8c8c'\n                    else\n                        color = 'ff00ffff'\n                    end\n                    \n                    entry = WrapTextInColorCode(string.format('%-35s',aura_env.get_text_snippet('rareList' .. todoQuest.id))..' = '..todoQuest.reputation, color) .. '\\r\\n'\n                    \n                    text = text .. entry\n                end\n            end\n        end\n    end\n    \n    return text\nend\n\naura_env.update_display = function()\n    local text = ''\n    ---rep avalible---\n    if aura_env.config['showReputation'] then\n        text = text .. WrapTextInColorCode(aura_env.get_text_snippet('reputationHeadline'), 'ff00ff96') .. '\\r\\n'\n        text = text .. aura_env.update_reputation_display() .. '--------------------------------\\r'\n    end\n    ---todo---\n    if aura_env.config['showOverview'] then\n        text = text .. WrapTextInColorCode(aura_env.get_text_snippet('overviewHeadline'), 'ff00ff96') .. '\\r\\n'\n        text = text .. aura_env.update_overview_display() .. '--------------------------------\\r'\n    end\n    ---rares---\n    if aura_env.config['showRareList'] then\n        text = text .. WrapTextInColorCode(aura_env.get_text_snippet('rareListHeadline'), 'ff00ff96') .. '\\r\\n'\n        text = text .. aura_env.update_rare_list_display() .. '--------------------------------\\r'\n    end\n    \n    return text\nend\n\naura_env.text = aura_env.update_display()\n\n",
