					["custom"] = "local L = GetLocale()\nlocal R = aura_env.config.locale and L == \"enUS\"\nlocal rares = {\n    {\n        name = R and \"Rares\" or \"Rare Mobs\", \n        quests = {65549,65553,65273,64716,65555,65544,64719,65583,65579,63988,65581,65551,65548,65257,65547,65582,65556,64668,65574,65549,65240,65272,65550,65580,65239,65584,65241,65251,58013, },\n    },\n    {\n        name = R and \"PWP 3day\" or \"Quest Patterns Within Patterns (3 day's reset)\",\n        quests = {65324,},\n    },\n    --    {\n    name = R and \"WQ\" or \"World Quest\",\n    quests = { 64358, 64359,64360,\n        --        },\n    },\n    {\n        name = R and \"WB\" or \"World Boss\",\n        quests = {65143,},\n    },\n}\n\naura_env.update_display = function()\n    local text = \"\"\n    for _, rare in ipairs(rares) do\n        local active = rare.active and rare.active() or not rare.active\n        if active then\n            local c = 0\n            local m = #rare.quests\n            local color = \"|cFFff0ff0\"\n            \n            for _, q in ipairs(rare.quests) do\n                if C_QuestLog.IsQuestFlaggedCompleted(q) then\n                    c = c + 1\n                end\n            end\n            \n            if c == m then color = \"|c00ffFF00\" end\n            if not aura_env.config.hide or aura_env.config.hide and c < m then\n                text = format(\"%s%s: %s%s/%s|r|n\", text, rare.name, color, c, m)\n            end\n        end\n    end\n    \n    return text\nend\n\naura_env.update_display()",
